    data: |
      SELECT 44 AS col2, + ( - col0 ) FROM tab1 AS cor0 WHERE NOT ( - col0 * - 65 * + - CAST ( NULL AS REAL ) * + - col2 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q9690.out
    data: |
      44	-51
      44	-85
      44	-91
